description:
This is a partial archive of the Norwegian podcast Kommisjonen on Kanal24.


The show was hosted by Atle Antonsen and Johan Golden. As the radio channel went bust a few years ago it was impossible for me to get hold of anyone who would answer questions about the status of copyright...


